    const elements = data.map(item => {
        const {id, ...itemProps} = item;
        return (
            // <EmployeesListItem name={item.name} salary={item.salary}/>
            <EmployeesListItem 
            key={id} 
            {...itemProps}
            onDelete = {() =>console.log('Deleted')}/>
        )
    })

    return (
        <ul className='app-list list-group'>
           {elements}
        </ul>
    )
}

export default EmployeesList;
